import React from 'react';
import {Typography, Card,CardHeader, CardActions, CardContent, CardMedia ,} from '@mui/material'
import cardImg from './1.png';
function Cards(props) {
    return (
        <div>
            <Card  sx={{ maxWidth: 284 }}>
     <CardMedia 
      component="img"
      height="292"
      image={cardImg} />
     <CardContent>
       <Typography variant='body2'></Typography>
     </CardContent>
    </Card>
        </div>
    );
}

export default Cards;
